    string LoadedPath = "`";
    void LoadDir(bool Refresh = false)
    {
        if (!Refresh && LoadedPath == Path)
        {
            return;
        }

        if (usr != null && usr.Validate(Path))
        {
            authed = true;
        }
        else
        {
            authed = false;
            Failed = true;
            return;
        }

        try
        {
            DE = FSService.ListFiles(Path);
        }
        catch (Exception ex)
        {
            Console.WriteLine("Explore error " + Path + " >> " + ex.Message);
            DE = new DirectoryEntries();
            msg = "1";
            Failed = true;
            Core.Log(msg + $"\t {Userdata.Token}");
        }

        LoadedPath = Path;

        StateHasChanged();
    }

    protected override async Task OnAfterRenderAsync(bool firstRender)
